        for(auto e: b)              cntb[e]++;
        for(int i=0; i<m; i++)      cnta[a[i]]++;
 
        int ans = 0;
        int c = 0;
 
        for(auto [e, _]: cntb)      c += min(cnta[e], cntb[e]);
 
