int n;
const int N = 1e6 + 5;
int dp[N][4];
int rec(int sum , int one){
    // base case;
    if(one > 3) return 0;
    if(sum >= n) return sum == n and !one;

    // memo
    int & ret = dp[sum][one];
    if(~ret) return ret;

    // rec

    ret = 0;

    if(!one){
        ret += rec(sum + 2 , 2);
        ret += rec(sum + 1 , one + 1);
    }

    ret += rec(sum + 2 , 0);

    return ret;

}
void solve(){
    cin >> n;

    for(auto & i : dp){
        memset(i , -1 , sizeof i);
    }

    cout << rec(1 , 1) + rec(2 , 0) << nl;

}

int main() {
    Sira();
    int t = 1;
//    cin >> t;
    while(t--){
        solve();
    }
    return 0;
}

local function movement(amount, func)
    amount = amount or 1
    for i = 1, amount do
        local r = func()
        if not r then
            return r
        end
    end
end

function d(amount)
    return movement(amount, turtle.down)
end


function u(amount)
    return movement(amount, turtle.up)
end


function f(amount)
    return movement(amount, turtle.forward)
end


function b(amount)
    return movement(amount, turtle.back)
end


function l(amount)
    return movement(amount, turtle.turnLeft)
end


function r(amount)
    return movement(amount, turtle.turnRight)
end

class SingleLabelCell: UICollectionViewCell {
	static let identifier: String = "singleLabelCell"
	
	let theLabel: UILabel = {
		let v = UILabel()
		v.font = .systemFont(ofSize: 14.0, weight: .light)
		v.textAlignment = .center
		v.numberOfLines = 0
		v.backgroundColor = UIColor(white: 0.9, alpha: 1.0)
		v.layer.cornerRadius = 12
		v.clipsToBounds = true
		v.translatesAutoresizingMaskIntoConstraints = false
		return v
	}()
	override init(frame: CGRect) {
		super.init(frame: frame)
		commonInit()
	}
	required init?(coder: NSCoder) {
		super.init(coder: coder)
		commonInit()
	}
	func commonInit() -> Void {
		contentView.addSubview(theLabel)
		let g = contentView
		NSLayoutConstraint.activate([
			theLabel.topAnchor.constraint(equalTo: g.topAnchor, constant: 4.0),
			theLabel.leadingAnchor.constraint(equalTo: g.leadingAnchor, constant: 4.0),
			theLabel.trailingAnchor.constraint(equalTo: g.trailingAnchor, constant: -4.0),
			theLabel.bottomAnchor.constraint(equalTo: g.bottomAnchor, constant: -4.0),
		])
		
		// during development, so we can see the cell framing
		contentView.backgroundColor = .systemYellow
	}
}

class SampleViewController: UIViewController, UICollectionViewDataSource, UICollectionViewDelegate {
	
	var collectionCarousel: UICollectionView!
	
	override func viewDidLoad() {
		super.viewDidLoad()
		view.backgroundColor = .systemBackground
		
		// horizontal flow layout
		let fl = UICollectionViewFlowLayout()
		fl.scrollDirection = .horizontal
		fl.minimumLineSpacing = 8
		fl.minimumInteritemSpacing = 8
		fl.itemSize = .init(width: 80.0, height: 40.0)
		collectionCarousel = UICollectionView(frame: .zero, collectionViewLayout: fl)
		
		collectionCarousel.translatesAutoresizingMaskIntoConstraints = false
		view.addSubview(collectionCarousel)
		
		let g = view.safeAreaLayoutGuide
		NSLayoutConstraint.activate([
			// constrain collectionView to Top/Leading/Trailing of safe-area
			collectionCarousel.topAnchor.constraint(equalTo: g.topAnchor, constant: 0.0),
			collectionCarousel.leadingAnchor.constraint(equalTo: g.leadingAnchor, constant: 0.0),
			collectionCarousel.trailingAnchor.constraint(equalTo: g.trailingAnchor, constant: 0.0),
			collectionCarousel.heightAnchor.constraint(equalToConstant: 50.0),
		])
		
		collectionCarousel.register(SingleLabelCell.self, forCellWithReuseIdentifier: SingleLabelCell.identifier)
		collectionCarousel.dataSource = self
		collectionCarousel.delegate = self
		
		// so we can see the collection view framing
		collectionCarousel.backgroundColor = UIColor(white: 0.9, alpha: 1.0)
		
	}
	
	var bFirstLayout: Bool = true
	override func viewDidLayoutSubviews() {
		super.viewDidLayoutSubviews()
		
		// if this is the first layout of this controller,
		//	center section 8 horizontally (but not animated)
		if bFirstLayout {
			bFirstLayout = false
			selectItemAndScroll(8, animated: false)
		}
	}
	
	func numberOfSections(in collectionView: UICollectionView) -> Int {
		return 11
	}
	func collectionView(_ collectionView: UICollectionView, numberOfItemsInSection section: Int) -> Int {
		return 1
	}
	func collectionView(_ collectionView: UICollectionView, cellForItemAt indexPath: IndexPath) -> UICollectionViewCell {
		let c = collectionView.dequeueReusableCell(withReuseIdentifier: SingleLabelCell.identifier, for: indexPath) as! SingleLabelCell
		c.theLabel.text = "\(indexPath.section)"
		return c
	}
	
	func selectItemAndScroll(_ setIndex: Int = 0, animated: Bool ) {
		let startIndexPath = IndexPath(item: 0, section: setIndex)
		collectionCarousel.selectItem(at: startIndexPath,
									  animated: animated,
									  scrollPosition: .centeredHorizontally)
	}
}

#define MEM_E 12  // E or chip select or crystal select
#define MEM_D 19  // input data to memory
#define MEM_W 4   // write
#define MEM_Q 5   // output data from memory

#define MEM_A0 11
#define MEM_A1 10
#define MEM_A2 9
#define MEM_A3 8

#define MEM_A4 13
#define MEM_A5 14
#define MEM_A6 15
#define MEM_A9 16
#define MEM_A8 17
#define MEM_A7 18

#define MEM_A11 6
#define MEM_A10 7

/*    
      User functions
  */
void setAddress(const unsigned offset) {
  bool result;
  result = (offset & 0b00000000000000000000000000000001) != 0;
  digitalWrite(MEM_A0, result);
  result = (offset & 0b00000000000000000000000000000010) != 0;
  digitalWrite(MEM_A1, result);
  result = (offset & 0b00000000000000000000000000000100) != 0;
  digitalWrite(MEM_A2, result);
  result = (offset & 0b00000000000000000000000000001000) != 0;
  digitalWrite(MEM_A3, result);
  result = (offset & 0b00000000000000000000000000010000) != 0;
  digitalWrite(MEM_A4, result);
  result = (offset & 0b00000000000000000000000000100000) != 0;
  digitalWrite(MEM_A5, result);
  result = (offset & 0b00000000000000000000000001000000) != 0;
  digitalWrite(MEM_A6, result);
  result = (offset & 0b00000000000000000000000010000000) != 0;
  digitalWrite(MEM_A7, result);
  result = (offset & 0b00000000000000000000000100000000) != 0;
  digitalWrite(MEM_A8, result);
  result = (offset & 0b00000000000000000000001000000000) != 0;
  digitalWrite(MEM_A9, result);
  result = (offset & 0b00000000000000000000010000000000) != 0;
  digitalWrite(MEM_A10, result);
  result = (offset & 0b00000000000000000000100000000000) != 0;
  digitalWrite(MEM_A11, result);
}

void writeCycle(const bool value, const int diapasonStart, const int diapasonEnd) {
  int dataOffset = diapasonStart;

  digitalWrite(MEM_W, 1);

  while (dataOffset <= diapasonEnd) {
    digitalWrite(MEM_E, 1);
    setAddress(dataOffset);
    digitalWrite(MEM_E, 0);
    digitalWrite(MEM_D, value);
    digitalWrite(MEM_W, 0);
    digitalWrite(MEM_W, 1);
    dataOffset++;
  }
}

void earlyWriteCycle(const bool value, const unsigned diapasonStart, const unsigned diapasonEnd) {
  unsigned dataOffset = diapasonStart;

  digitalWrite(MEM_W, 0);

  while (dataOffset <= diapasonEnd) {
    digitalWrite(MEM_E, 1);
    setAddress(dataOffset);
    digitalWrite(MEM_D, value);
    digitalWrite(MEM_E, 0);
    dataOffset++;
  }
}

void checkCycle(const bool value, const unsigned diapasonStart, const unsigned diapasonEnd) {
  unsigned dataOffset = diapasonStart;
  unsigned errorCounter = 0;

  digitalWrite(MEM_W, 1);

  while (dataOffset <= diapasonEnd) {
    setAddress(dataOffset);
    digitalWrite(MEM_E, 0);

    if (digitalRead(MEM_Q) == value) {
    } else {
      errorCounter++;
    }

    digitalWrite(MEM_E, 1);
    dataOffset++;
  }

  Serial.print("Total number of errors - ");
  Serial.println(errorCounter);  //вывод количества ошибок
}


/*    
      Tests
  */

void Test_MATS_PLUS() {
  //первый шаг теста, пишем 0 во все ячейки
  writeCycle(0, 0, 4095);

  //второй шаг теста, в каждой ячейке проверям на 0 и затем пишем 1
  unsigned errorCounter = 0;
  for (int i = 0; i < 4096; i++) {
    //проверка на 0
    digitalWrite(MEM_W, 1);
    digitalWrite(MEM_E, 1);
    setAddress(i);
    digitalWrite(MEM_E, 0);
    if (digitalRead(MEM_Q) == 0) {
      //если в ячейке памяти 0, то ничего не делаем
    } else {           //если в ячейке 1, то это ошибка
      errorCounter++;  //увеличиваем количество ошибок на 1
    }
    digitalWrite(MEM_E, 1);

    //запись 1
    //закомментирован late write cycle
    // digitalWrite(MEM_W, 1);
    // digitalWrite(MEM_E, 1);
    // setMemPorts(i);
    // digitalWrite(MEM_E, 0);
    // digitalWrite(MEM_D, 1);
    // digitalWrite(MEM_W, 0);
    // digitalWrite(MEM_W, 1);

    //используется early write cycle
    digitalWrite(MEM_W, 0);
    digitalWrite(MEM_E, 1);
    setAddress(i);
    digitalWrite(MEM_D, 1);//из-за этого конфликт
    digitalWrite(MEM_E, 0);
  }

  Serial.print("Total number of errors after (r0+w1) - ");
  Serial.println(errorCounter);  //вывод количества ошибок
}


