using namespace std;
 
int N, M, a, b, ds[100001];
vector<pair<int, int>> ans;
 
int findLeader(int x){
    if (ds[x] < 0)
        return x;
    return findLeader(ds[x]);
}
 
bool unite(int u, int v){
    u = findLeader(u);
    v = findLeader(v);
    
    if (u == v)
        return false;
        
    if (ds[u] < ds[v])
        swap(u, v);
 
    ds[v] += ds[u];
    ds[u] = v;
    return true;
}
 
int main(){
    cin >> N >> M;
    for (int i=1; i <= N; i++)
        ds[i] = -1;
 
    for (int i=0; i < M; i++){
        cin >> a >> b;
        unite(a, b);
    }
 
    for (int i=1; i < N; i++)
        if (unite(i, i+1))
            ans.push_back({i, i+1});
 
    cout << ans.size() << endl;
    for (auto next : ans)
        cout << next.first << " " << next.second << endl;
}

