let input = [
    '0',
    '10,20,30,40,50',
    '2 forward 1',
    '2 backwards 1',
    '3 forward 2',
    '3 backwards 2',
    'exit',
];

let print = this.print || console.log;
let gets = this.gets || ((arr, index) => () => arr[index++])(input, 0);

let position = Number(gets());
let mainArray = gets().split(',').map(Number);
let moveCounter = Infinity;
let forward = 0;
let backwards = 0;

for (let i = 0; i < moveCounter; i++) {
    let moves = gets();
    if(moves === 'exit'){
        break;
    }

    let copyMoves = moves.split(' ').slice('');
    let steps  = Number(copyMoves[0]);
    let direction = copyMoves[1];
    let size = Number(copyMoves[2]);
    
        for (let j = 0; j < steps; j++) {
            let currentIndex = position % mainArray.length;
    
            if (direction === 'forward') {
                currentIndex = (currentIndex + size) % mainArray.length;
                forward += mainArray[currentIndex];
                position = currentIndex;
            } else if (direction === 'backwards') {
                currentIndex = (currentIndex - size + mainArray.length) % mainArray.length;
                if(currentIndex < 0){
                    currentIndex += mainArray.length;
                }
                backwards += mainArray[currentIndex];
                position = currentIndex;
            } else {
                console.log('Wrong direction');
            }
        }
    
        
        

}

console.log(`Forward: ${forward}`);
console.log(`Backwards: ${backwards}`);

